import React from "react";
import {Link} from "react-router-dom";
export default function NavBar(){

    return(
        <div className="navcontainer">
            <li>
            <Link to="/">All Post</Link>    
            </li>
            <li>
            <Link to="/">Article</Link>    
            </li>
            <li>
            <Link to="/">Event</Link>    
            </li>
            <li>
            <Link to="/">Education</Link>    
            </li>
            <li>
            <Link to="/">Job</Link>    
            </li>
        </div>
    );
}
